import styles from "./../assets/components/Services.module.css";
import logoCaddy from "./../assets/img/caddy-logo.png";
import logoMongo from "./../assets/img/mongoDB-logo.png";

import Service from "./Service";

function Services(){
    return (
        <div>
            <div className={styles.title}>
                <p>Services</p>
            </div>
            <div className={styles.containerServices}>
                <Service 
                    nameService="Caddy"
                    logo={logoCaddy}
                />
                <Service 
                    nameService="MongoDB"
                    logo={logoMongo}
                />
                <Service 
                    nameService="Servidor"
                    logo={logoCaddy}
                />
            </div>
        </div>
    );
}

export default Services;
